import React from "react";
import Books from "./pages/Books";
import Nav from "./components/Nav";
import Wrapper from "./components/Wrapper";
function App() {
  return (
    <Wrapper>
    <div>
      <Nav />
      <Books />
      <Switch>
          <Route exact path={["/", "/books"]}>
            <Books />
          </Route>
          <Route exact path="/books/:id">
            <Detail />
          </Route>
          <Route>
            <NoMatch />
          </Route>
        </Switch>
    </div>
    </Wrapper>
  );
}

export default App;
